  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) maps for the shoreline of southern California. ESI data
  characterize coastal environments and wildlife by their sensitivity to spilled oil.
  The ESI data include information for three main components: shoreline habitats,
  sensitive biological resources, and human-use resources. This atlas was developed
  to be utilized within desktop GIS systems and contains GIS files and related D-base
  files. Associated files include MOSS (Multiple Overlay Statistical System) export
  files, .PDF maps, and detailed user guides and metadata.\",\n\t\"license_title\":
